import styled from 'styled-components'
import 'reset-css';

// import { baseTheme } from 'styles/theme'

const StyledHeader = styled.header`
    top:0;
    right: 100px;
    width: 100%;
    height: 50px;
    background: purple;
    position: sticky;
    color: white;
    text-align: center;
    margin-top: 5px;
    padding-top: 10px;
    font-size: 40px;
`;

export const Header = () => {
<StyledHeader>TASK TRACKER</StyledHeader>
const StyledLink = styled(Link)`
color: white;
`;

<StyledLink to="/table"> Table </StyledLink>
}
